import React, { Component } from 'react';
import ArticleSummary from "./ArticleSummary"
import ContactMe from "./ContactMe"
import { ArticleMeta } from '../data/ArticleMeta'
import { Space, Divider, Typography } from 'antd';

import { ProjectsCarousel } from './ProjectsCarousel';
const { Title } = Typography


const articleEntries = [
  //{ArticleMeta(title="hello", published="1/1/1", summary="this is my summary", resource="www.")}
  { title: "hello1", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as ArticleMeta,
  { title: "hello2", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as ArticleMeta,
  { title: "hello1", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as ArticleMeta,
  { title: "hello2", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as ArticleMeta,
]

const projectEntries = [
  { title: "hello1", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as ArticleMeta,
  { title: "hello2", published: "True", code: "pythonxy", summary: "this is my summary", timestamp: "2020-05-06", resource: "www.test", slug: "slug1" } as ArticleMeta,
  //{title:"hello2", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.test", slug:"slug2"} as ArticleMeta,
  //{title:"hello3", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.test", slug:"slug3"} as ArticleMeta,
]

const Home: React.FC<{}> = (props: any) => {
  return (
    <div>
      <Space direction="vertical" style={{ width: "80%" }}>
        <div className="parallax">
          <div className="fade-in-title">Brendan Copp</div>
        </div>
        <div className="no-bottom-margin" style={{ marginTop: "15px" }}><h1>Recent Projects</h1></div>
        <Divider />
        <ProjectsCarousel entries={projectEntries} />
        <Divider />
        <h1>My Life Up Until Now</h1>
        <Divider />
        <ArticleSummary entries={articleEntries} />
        <Divider />
        <ContactMe />
      </Space>
    </div>
  )
}

export default Home
